import React, { Component } from 'react';

class Click extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: 0
    };
  }

  handlechange = () => {
    this.setState(prevState => ({
      data: prevState.data + 1
    }));
  };

  render() {
    return (
      <div>
        <button onClick={this.handlechange}> Hovered {this.state.data} Times </button>
      </div>
    );
  }
}

export default Click;
